import React, { Component } from "react";
import { connect } from "react-redux";
import { Link } from "react-router-dom";
import Header from "../../components/Header";
import Footer from "../../components/Footer";
import Breadcrumb from "../../components/Breadcrumb/EventBreadcrumbs";
import ScrollToTop from "../../components/ScrollTop";
import Logo from "../../assets/images/logos/logo2.png";
import { getEventById } from "../../services/eventServices";
import { toast } from "react-toastify";

class Recruitment extends Component {
    constructor(props) {
        super(props);
        this.state = {
            eventId: null,
            eventData: null,
            isLoading: true,
        };
    }
    render() {
        return (
            <div className="event-registration-container">
                <Header parentMenu="event" headerNormalLogo={Logo} headerStickyLogo={Logo} />
                <Breadcrumb title="Đăng ký tham gia sự kiện" image={Logo} altText="Event Registration" />
                <div className="event-registration-content">
                    <h2>Đăng ký tham gia sự kiện</h2>
                </div>
                <Footer />
                <ScrollToTop />
            </div>
        );
    }
}

const mapStateToProps = (state) => {
    return {
        language: state.app.language,
        isLoggedIn: state.user.isLoggedIn,
        userInforr: state.user.userInforr,
    };
};

const mapDispatchToProps = (dispatch) => {
    return {};
};

export default connect(mapStateToProps, mapDispatchToProps)(Recruitment);
